import './App.css';
import Footer from './Footer';
import GalleryComponent from './GalleryComponent';
import { FaFacebook, FaTwitter, FaInstagram } from 'react-icons/fa';

function App() {
  return (
    <div className="App">
      <GalleryComponent style={{ flex: 1 }}/>
      <Footer>
      <div>
          <FaFacebook style={{ marginRight: '10px', color: '#fff' }} />
          <FaTwitter style={{ marginRight: '10px', color: '#fff' }} />
          <FaInstagram style={{ color: '#fff' }} />
        </div>
      </Footer>
    </div>
  );
}

export default App;
